import React from 'react';

const Hero = () => (
  <section id="hero" className="h-screen snap-start flex flex-col justify-center items-center text-center bg-gradient-to-br from-blue-100 to-purple-100 px-4">
    <h1 className="text-5xl font-bold mb-4">Hi, I'm Vasudha Maddi</h1>
    <p className="text-lg max-w-xl">A passionate Full Stack Developer with expertise in building scalable, cloud-native applications using Java, Spring Boot, React, and AWS.</p>
  </section>
);

export default Hero;
